  <body>
    <form action="http://osl.vvce.ac.in">
      <div class="container-contact100">
        <div class="wrap-contact100">
          <form class="contact100-form validate-form">
            <span class="contact100-form-title">
              OPEN SOURCE DAY
            </span>

            <div class="wrap-input100 validate-input">
              <span class="label-input100">Your Name</span>
              <input
                id="name"
                class="input100"
                type="text"
                name="name"
                placeholder="Enter your name"
              />
              <span class="focus-input100"></span>
            </div>

            <div class="wrap-input100 validate-input">
              <span class="label-input100">Phone</span>
              <input
                id="phone"
                class="input100"
                type="tel"
                name="phone"
                placeholder="Enter your phone number"
              />
              <span class="focus-input100"></span>
            </div>

            <div class="">
              <span class="label-input1001">Tracks</span> <br />
              <span>Choose one of the below packages</span>
              <div class="row crow">
                <a>
                <div class="col-md-6 btn" id="cbtn1">
                  <span class="package">Package 1</span> <br />
                  <ul>
                    <li class="list">
                      Ethical Hacking Workshop
                    </li>
                    <li class="list">Lunch</li>
                    <li class="list">Goodies</li>
                  </ul>
                </div>
                </a>
                <a>
                <div class="col-md-6 btn" id="cbtn2">
                  <span class="package">Package 2</span><br />
                  <ul>
                    <li class="list">GitHub Workshop</li>
                    <li class="list">Lunch</li>
                    <li class="list">Goodies</li>
                  </ul>
                </div>
              </div>
            </div>

            <div class="container-contact100-form-btn">
              <div class="wrap-contact100-form-btn">
                <div class="contact100-form-bgbtn"></div>
                <button id="submit" class="contact100-form-btn">
                  <span>
                    Proceed to RSVP
                    <i
                      class="fa fa-long-arrow-right m-l-7"
                      aria-hidden="true"
                    ></i>
                  </span>
                </button>
              </div>
            </div>
          </form>
        </div>
      </div>
    </form>
